" [nzHref]=\"'https://github.com/NG-ZORRO/ng-zorro-antd/edit/master/components/input/demo/autosize-textarea.md'\">\n\t<nz-demo-input-autosize-textarea demo></nz-demo-input-autosize-textarea>\n\t<div intro ngNonBindable>\n\t\t<p><code>nzAutosize</code> 属性适用于 <code>textarea</code> 节点，并且只有高度会自动变化。另外 <code>nzAutosize</code> 可以设定为一个对象，指定最小行数和最大行数。</p>\n\n\t</div>\n</nz-code-box>\n<nz-code-box nzTitle=\"前缀和后缀\" [nzId]=\"'components-input-demo-presuffix'\" nzSelector=\"nz-demo-input-presuffix\" [nzLink]=\"'components-input-demo-presuffix'\" nzGenerateCommand=\"ng g ng-zorro-antd:input-presuffix -p app --name=\" nzComponentName=\"NzDemoInputPresuffixComponent\" [nzCode]=\"presuffix\" [nzRawCode]=\"presuffixRaw\" nzIframeSource=\"null\" nzIframeHeight=\"null\" [nzHref]=\"'https://github.com/NG-ZORRO/ng-zorro-antd/edit/master/components/input/demo/presuffix.md'\">\n\t<nz-demo-input-presuffix demo></nz-demo-input-presuffix>\n\t<div intro ngNonBindable>\n\t\t<p>在输入框上添加前缀或后缀图标。</p>\n\n\t</div>\n</nz-code-box>\n\n\t</div>\n\t<div nz-col [nzLg]=\"12\" [nzMd]=\"24\">\n\t\t<nz-code-box nzTitle=\"三种大小\" [nzId]=\"'components-input-demo-size'\" nzSelector=\"nz-demo-input-size\" [nzLink]=\"'components-input-demo-size'\" nzGenerateCommand=\"ng g ng-zorro-antd:input-size -p app --name=\" nzComponentName=\"NzDemoInputSizeComponent\" [nzCode]=\"size\" [nzRawCode]=\"sizeRaw\" nzIframeSource=\"null\" nzIframeHeight=\"null\" [nzHref]=\"'https://github.com/NG-ZORRO/ng-zorro-antd/edit/master/components/input/demo/size.md'\">\n\t<nz-demo-input-size demo></nz-demo-input-size>\n\t<div intro ngNonBindable>\n\t\t<p>我们为 <code>&lt;Input /&gt;</code> 输入框定义了三种尺寸（大、默认、小），高度分别为 <code>40px</code>、<code>32px</code> 和 <code>24px</code>。</p>\n<p>注意： 在表单里面，我们只使用大尺寸的输入框。</p>\n\n\t</div>\n</nz-code-box>\n<nz-code-box nzTitle=\"输入框组合\" [nzId]=\"'components-input-demo-group'\" nzSelector=\"nz-demo-input-group\" [nzLink]=\"'components-input-demo-group'\" nzGenerateCommand=\"ng g ng-zorro-antd:input-group -p app --name=\" nzComponentName=\"NzDemoInputGroupComponent\" [nzCode]=\"group\" [nzRawCode]=\"groupRaw\" nzIframeSource=\"null\" nzIframeHeight=\"null\" [nzHref]=\"'https://github.com/NG-ZORRO/ng-zorro-antd/edit/master/components/input/demo/group.md'\">\n\t<nz-demo-input-group demo></nz-demo-input-group>\n\t<div intro ngNonBindable>\n\t\t<p>输入框的组合展现。</p>\n<p>注意：使用 <code>nzCompact</code> 模式时，不需要通过 <code>nz-col</code> 来控制宽度。</p>\n\n\t</div>\n</nz-code-box>\n<nz-code-box nzTitle=\"文本域\" [nzId]=\"'components-input-demo-textarea'\" nzSelector=\"nz-demo-input-textarea\" [nzLink]=\"'components-input-demo-textarea'\" nzGenerateCommand=\"ng g ng-zorro-antd:input-textarea -p app --name=\" nzComponentName=\"NzDemoInputTextareaComponent\" [nzCode]=\"textarea\" [nzRawCode]=\"textareaRaw\" nzIframeSource=\"null\" nzIframeHeight=\"null\" [nzHref]=\"'https://github.com/NG-ZORRO/ng-zorro-antd/edit/master/components/input/demo/textarea.md'\">\n\t<nz-demo-input-textarea demo></nz-demo-input-textarea>\n\t<div intro ngNonBindable>\n\t\t<p>用于多行输入。</p>\n\n\t</div>\n</nz-code-box>\n<nz-code-box nzTitle=\"输入时格式化展示\" [nzId]=\"'components-input-demo-tooltip'\" nzSelector=\"nz-demo-input-tooltip\" [nzLink]=\"'components-input-demo-tooltip'\" nzGenerateCommand=\"ng g ng-zorro-antd:input-tooltip -p app --name=\" nzComponentName=\"NzDemoInputTooltipComponent\" [nzCode]=\"tooltip\" [nzRawCode]=\"tooltipRaw\" nzIframeSource=\"null\" nzIframeHeight=\"null\" [nzHref]=\"'https://github.com/NG-ZORRO/ng-zorro-antd/edit/master/components/input/demo/tooltip.md'\">\n\t<nz-demo-input-tooltip demo></nz-demo-input-tooltip>\n\t<div intro ngNonBindable>\n\t\t<p>结合 <a href=\"/components/tooltip/zh\">Tooltip</a> 组件，实现一个数值输入框，方便内容超长时的全量展现。</p>\n\n\t</div>\n</nz-code-box>\n\n\t</div>\n</div>\n<section class=\"markdown api-container\" ngNonBindable><h2 id=\"api\"><span>API</span><a onclick=\"window.location.hash = 'api'\" class=\"anchor\">#</a></h2><h3 id=\"[nz-input]\"><span>[nz-input]</span><label class=\"api-type-label directive\">directive</label><a onclick=\"window.location.hash = '[nz-input]'\" class=\"anchor\">#</a></h3><p>nz-input 可以使用所有的W3C标准下的所有 <a href=\"https://www.w3schools.com/tags/tag_input.asp\">使用方式</a> 和 Angular对 input 的全部额外功能支持。</p>\n<table>\n<thead>\n<tr>\n<th>参数</th>\n<th>说明</th>\n<th>类型</th>\n<th>默认值</th>\n</tr>\n</thead>\n<tbody>\n<tr>\n<td><code>[nzAutosize]</code></td>\n<td>只可以用于 <code>textarea</code>，自适应内容高度，可设置为 <code>boolean</code> 或对象：<code>&#123; minRows: 2, maxRows: 6 &#125;</code></td>\n<td>boolean丨 <code>&#123; minRows: number, maxRows: number &#125;</code></td>\n<td>false</td>\n</tr>\n<tr>\n<td><code>[nzSize]</code></td>\n<td>控件大小。注：标准表单内的输入框大小限制为 <code>large</code>。可选 <code>large</code> <code>default</code> <code>small</code></td>\n<td>string</td>\n<td><code>default</code></td>\n</tr>\n</tbody>\n</table>\n<h3 id=\"nz-input-group\"><span>nz-input-group</span><label class=\"api-type-label component\">component</label><a onclick=\"window.location.hash = 'nz-input-group'\" class=\"anchor\">#</a></h3><table>\n<thead>\n<tr>\n<th>参数</th>\n<th>说明</th>\n<th>类型</th>\n<th>默认值</th>\n</tr>\n</thead>\n<tbody>\n<tr>\n<td><code>[nzAddOnAfter]</code></td>\n<td>带标签的 input，设置后置标签</td>\n<td>string 丨 <code>TemplateRef&lt;void&gt;</code></td>\n<td></td>\n</tr>\n<tr>\n<td><code>[nzAddOnBefore]</code></td>\n<td>带标签的 input，设置前置标签</td>\n<td>string 丨 <code>TemplateRef&lt;void&gt;</code></td>\n<td></td>\n</tr>\n<tr>\n<td><code>[nzPrefix]</code></td>\n<td>带有前缀图标的 input</td>\n<td>string丨 <code>TemplateRef&lt;void&gt;</code></td>\n<td></td>\n</tr>\n<tr>\n<td><code>[nzSuffix]</code></td>\n<td>带有后缀图标的 input</td>\n<td>string丨 <code>TemplateRef&lt;void&gt;</code></td>\n<td></td>\n</tr>\n<tr>\n<td><code>[nzCompact]</code></td>\n<td>是否用紧凑模式</td>\n<td>boolean</td>\n<td>false</td>\n</tr>\n<tr>\n<td><code>[nzSearch]</code></td>\n<td>是否用搜索框</td>\n<td>boolean</td>\n<td>false</td>\n</tr>\n<tr>\n<td><code>[nzSize]</code></td>\n<td><code>nz-input-group</code> 中所有的 <code>nz-input</code> 的大小，可选 <code>large</code> <code>default</code> <code>small</code></td>\n<td>string</td>\n<td><code>default</code></td>\n</tr>\n</tbody>\n</table>\n</section></article>"

